import { Link } from "@material-ui/core";
import React from "react";
import logo from "../../assets/pasgo.jpg";

const Logo = (props) => {
  return (
    <Link to="sign-in">
      <img src={logo} alt="Logo" {...props} />
    </Link>
  );
};

export default Logo;
